met de stemmen van Bill Hader, Anna Faris en James Caan

Flint Lockwood (Bill Hader) is een mislukte uitvinder, die met creaties als een apengedachtenvertaler helaas weinig succes 
oogst. Tot hij op een dag een machine uitvindt die ervoor zorgt dat het donuts, ijsjes en gehaktballen regent. De enige vriend 
en collega van Flint is Steve, een aapje dat alleen maar aan eten denkt. Sam (Anna Farris) is een enthousiaste stagiaire die 
voor een weerstation werkt. Ze droomt er van om een professionele weervrouw te worden en die droom zou wel eens werkelijkheid 
kunnen worden wanneer ze als enige bericht over een bui van cheeseburgers.
